import React, { Fragment } from "react";

import { ListItem } from "./ListItem";

export const List = props => {
  const dataDisplay = props.p.map(p => {
    return <ListItem data={p} key={p.id} />;
  });
  console.log(props.p);

  return <Fragment>{dataDisplay}</Fragment>;
};
